import React from "react";
import "./Sidebar.css";
import User from "../containers/User";

export default class Sidebar extends React.Component{
	constructor(props){
		super(props);
	}
	render(){
		return(
			<aside className="sidebar">
				{this.props.contacts.forEach(
					contact => <User user={contact} key={contact.id} />
				)}
			</aside>
		);
	}
}
